<div class="documentationViewer">
	<div id="DocBasicInfo" class="basicInfoContainer">

					<div class="br version" />
					<div class="br created" />
					<div class="br updated" />
				</div>
			</div>
			<div class="section classInfo">
				<div class="classTitle" />
				<p class="classDescription" />

					<div class="classExtends">
						<h4 data-literal='{"name":"lbl_inheritance"}' />

					</div>
					<div class="classImplements" />
				</div>
			</div>
		</div>
	</div>
	<div id="DocBody" class="bodyDetailsContainer">

			<h2 class="hd synopsis selected" data-literal='{"name":"lbl_man_classSynopsis"}' />

		</div>
		<div id="docSynopsis" class="section">
			<div class="body">
				<div class="constantsContainer">
					<div class="subHeader" data-literal='{"name":"lbl_constantsHeader"}' />

				</div>
				<div class="propertiesContainer">
					<div class="subHeader" data-literal='{"name":"lbl_propertiesHeader"}' />
					<div class="sectionBody" />
				</div>
				<div class="methodsContainer">
					<div class="subHeader" data-literal='{"name":"lbl_methodsHeader"}' />
					<div class="sectionBody" />
				</div>
			</div>
		</div>
		<div id="docManual" class="section" />
	</div>
	<div class="section changelog">
		<h2 class="header" data-literal='{"name":"lbl_man_changelog"}' />
		<div class="body">No Changes.</div>
	</div>
</div>
